import { Component } from '@angular/core';

@Component({
  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent {

}
<div class='container-fluid m-5 '>
  <div class='row'>
    <div class='col'>
      <h1>About us</h1>
      <br>
      <p><strong>Programador: </strong><em>Carlos M.</em></p>
      <p><strong>Versión: </strong><em> v1.0</em></p>
      <p><strong>Fecha desarrollo: </strong><em>09/12/2022</em></p>
    </div>
  </div>
</div>
